    <style>
        @font-face {
            font-family: 'myfont';
            src: url(data:font/truetype;charset=utf-8;base64,);
            font-weight: normal;
            font-style: normal;
        }
        body {
            font-family: 'myfont', sans-serif !important;
            margin: 0;
        }
        .header,
        .footer {
            width: 100%;
            text-align: center;
            position: fixed;
            font-family: 'myfont', sans-serif !important;

        }
        .header {
            top: 0px;
        }
        .footer {
            bottom: 0px;
        }
        .pagenum:before {
            content: counter(page);
        }

        .heading-p{
            font-size: 12px;
            color: #000
        }

        .body-p{
            font-size: 12px;
            color: #000
        }

        .body-table-p{
            font-size: 12px;
            text-align: center !important;
            color: #000;

        }
        
        .body-heading {
            font-size: 24px;
            text-align:center;
            color: #000
        }

        .body-p-sub{
            font-size: 12px;
            color: #000

        }


        /* Set page size and margins for A4 (portrait) */
        @page {
            size: A4 portrait;
            margin: 0.5cm;
        }

        .second-page-section {
            page-break-before: always; /* Force section to start on second page */
        }
        .content {
            font-family: 'myfont', sans-serif !important;
            break-after: page; /* Force page break after main content */
        }

        @media screen {
            footer.divFooter {
                display: none;
            }
        }

        
    </style>
</head>
